11. Nominations and Scheduling  

11.1 Transporter shall accept nominations twenty-four (24) hours a Day via the EDI that is authorized by the Commission. All nominations submitted to and accepted by Transporter must contain, at a minimum, the mandatory data elements included in the NAESB standards and any additional business-conditional or mutually agreeable data elements. In addition, nominations must be stated in Dths, and specify a begin and an end date, which dates must be for a minimum period of one (1) Day and must be within the term of Shipper's Agreement. At the end of each Day, Transporter shall provide the final scheduled quantities for the just completed Day. With respect to the implementation of this process via the EDI, Transporter shall send an end of Day Scheduled Quantity (NAESB WGQ Standard 1.4.5) and Scheduled Quantity for Operator (NAESB WGQ Standard 1.4.6). A receiver of either of these documents can waive Transporter's requirement to send such documents.

11.2 Submission of Nominations

(a) All new or revised nominations must be communicated via EDI unless otherwise mutually agreed and must be submitted in accordance with the standard nomination timelines set forth below. A revised nomination supersedes the previous nomination in effect, but only for the Days specified in such revised nomination, after which the previous nomination once again takes effect until its end date or until superseded by another new or revised nomination, whichever is earlier. 

The standard nomination timelines are as follows:

(1) The Timely Nomination Cycle:
(All times are CCT on the Day prior to the Service Day.)

1:00 p.m. Latest time that nominations may leave control of the service requester;

1:15 p.m. Receipt of nominations by Transporter (including from Title Transfer Tracking Service Providers (TTTSPs));

1:30 p.m. Transporter sends the quick response to the service requester;

4:30 p.m. Receipt of completed confirmations by Transporter from confirming parties;

5:00 p.m. Service requester and point operator receive scheduled quantities from Transporter.

Scheduled quantities resulting from the Timely Nomination Cycle shall be effective at 9:00 a.m. CCT on the start of the next Service Day.

(2) The Evening Nomination Cycle:
(All times are CCT on the Day prior to the Service Day.)

6:00 p.m. Latest time that nominations may leave control of the service requester;

6:15 p.m. Receipt of nominations by Transporter (including from TTTSPs);

6:30 p.m. Transporter sends the quick response to the service requester; 

8:30 p.m. Receipt of completed confirmations by Transporter from confirming parties;

9:00 p.m. Transporter provides scheduled quantities to the affected service requester and point operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from the Evening Nomination Cycle shall be effective at 9:00 a.m. CCT on the start of the next Service Day.

(3) The Intraday 1 Nomination Cycle:
(All times are CCT on the current Service Day.)

10:00 a.m. Latest time that nominations may leave control of the service requester;

10:15 a.m. Receipt of nominations by Transporter (including from TTTSPs);

10:30 a.m. Transporter sends the quick response to the service requester;

12:30 p.m. Receipt of completed confirmations by Transporter from confirming parties;

1:00 p.m. Transporter provides scheduled quantities to the affected service requester and point operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from the Intraday 1 Nomination Cycle shall be effective at 2:00 p.m. CCT on the current Service Day.

(4) 	The Intraday 2 Nomination Cycle:
(All times are CCT on the current Service Day.)

2:30 p.m. Latest time that nominations may leave control of the service requester;

2:45 p.m. Receipt of nominations by Transporter (including from TTTSPs);

3:00 p.m. Transporter sends the quick response to the service requester;

5:00 p.m. Receipt of completed confirmations by Transporter from confirming parties;

5:30 p.m. Transporter provides scheduled quantities to the affected service requester and point operator, including bumped parties (notice to bumped parties).

Scheduled quantities resulting from the Intraday 2 Nomination Cycle shall be effective at 6:00 p.m. CCT on the current Service Day.

(5) 	The Intraday 3 Nomination Cycle:
(All times are CCT on the current Service Day.)

7:00 p.m. Latest time that nominations may leave control of the service requester;

7:15 p.m. Receipt of nominations by Transporter (including from TTTSPs);

7:30 p.m. Transporter sends the quick response to the service requester;

9:30 p.m. Receipt of completed confirmations by Transporter from confirming parties;

10:00 p.m. Transporter provides scheduled quantities to the affected service requester and point operator.

Scheduled quantities resulting from the Intraday 3 Nomination Cycle shall be effective at 10:00 p.m. CCT on the current Service Day. Bumping is not allowed during the Intraday 3 Nomination Cycle.

(b) If a Shipper completes and resubmits an otherwise incomplete nomination, the first nomination cycle that occurs where the Shipper's complete nomination meets the deadline for nominations to leave a Shipper's control will apply to the Shipper's nomination.

(c) Variations by Shipper of actual deliveries to Transporter from the nominated deliveries at the Receipt Point(s) shall be kept to a minimum. In addition, variations by Shipper of actual receipts from Transporter from the nominated receipts at the Delivery Point(s) shall be kept to a minimum. If the nominated quantity cannot be delivered or received at uniform daily rates, provisions to deliver the Gas at a nonuniform rate must be made with Transporter's Gas Control Department prior to Gas flowing.

(d) Any nomination that is submitted and validated by EDI shall be considered valid. If the nomination of Transporter's Use is inaccurate by five (5) Dths or more, the nomination will not be considered valid.

(e) Any shipper may designate an agent, which may be Transporter, to nominate and schedule Transportation Service on Shipper's behalf. Shipper shall notify Transporter, in writing of the designated agent. An agent who has been designated to nominate and schedule Transportation Service for more than one Shipper may provide aggregate nomination(s) for multiple Shippers. Transporter is authorized to rely on nominations and scheduling information provided by Shipper's agent. By designating an agent, Shipper agrees to indemnify and save Transporter harmless from all suits, actions, debts, accounts, damages, costs, losses and expenses arising in any way from Shipper's agent's actions on behalf of Shipper, Shipper's agent's failure to act on behalf of Shipper, or Transporter's reliance upon the information provided to Transporter by Shipper's agent; provided, however that such indemnification will not excuse Transporter from liability for actions taken when Transporter is acting as agent.

11.3 Implementation of Intraday Nominations.

(a) Subject to the deadlines in Section 11.2(a)(3) through (a)(5), above, intraday nominations may be nominated twenty-four (24) hours a Day and will be processed in the same manner as other nominations. However, the nomination deadline and effective time of intraday nominations specified in Section 11.2(a), above, will not apply to OFO-related intraday nominations.

(b) Subject to upstream and downstream operators' confirmations and Transporter's operating conditions, an intraday nomination submitted pursuant to one of the deadlines set forth in Section 11.2(a), above, can be used to request increases or decreases in total flow, changes to Receipt Points, or changes to Delivery Points, of scheduled Gas. Transporter will not accept a reduced intraday nomination for any quantity deemed already delivered based on an Elapsed-Prorated-Scheduled Quantity.

(c) Transporter shall allow Shipper to alter the order of priority of receipts and deliveries, upon which Transporter shall rely in taking actions to adjust receipts and/or deliveries, provided that such changes are submitted via EDI in accordance with the nomination deadlines set forth in Section 11.2(a), above. If Shipper adds a new nomination at a Receipt Point or Delivery Point under its Agreement during the Service Day, or if a Pooler designates the addition of a new downstream Shipper during the Service Day, provided that any of such additions is not performed simultaneously with a change in priorities that accommodates the new receipt or delivery, Transporter shall place such addition as the last in priority to be affected by any changes.

(d) Notice. For purposes of providing notice of any nomination changes (including where an interruptible Shipper's nomination is bumped by a firm Shipper's intraday nomination) to a Shipper and/or Shipper's agent, Transporter shall use Electronic Communication. Intraday bump notices should indicate whether daily penalties will apply for the Gas Day for which quantities are reduced. With respect to changes initiated by Transporter, if a Shipper so elects, such Shipper may provide a telephone number and Transporter will contact Shipper at such phone number by means of Electronic Communication to alert Shipper that a change has been made. Such Shipper shall then be responsible for reviewing its account to obtain details of such change.

11.4 Delivery of Gas. Transporter, subject to the other provisions hereof, shall make daily delivery of Equivalent Quantities of Gas at the Delivery Point(s) that Shipper has nominated and Transporter has simultaneously received at Receipt Point(s). Shipper will not have the right to receive quantities of Gas that it has not simultaneously nominated and delivered to Transporter at Receipt Point(s). All nominations, excluding Intraday Nominations, shall have rollover options during each Month. Specifically, Shippers shall have the ability to nominate for several Gas Days in a given Month, up to and including the last Gas Day of the specific Month, provided the nomination begin and end dates are within the term of Shipper's contract. Such nominations shall be deemed "Standing Nominations." Shipper shall provide as a component of its nomination such information as may be required by Transporter to enable it to identify, confirm, and schedule the nomination. Shipper shall request Overrun quantities in a separate nomination.

11.5 Hourly Variation.  Except as otherwise agreed to by Transporter and Shipper and provided for in Shipper's service agreement, receipts and deliveries shall be made for all Notice Services at uniform hourly rates over a twenty-four (24) hour period, unless deviations from those receipt and delivery quantities are necessary for balancing purposes and are undertaken by Shipper at Transporter's request or following notice to, and approval by, Transporter in accordance with the applicable provisions of the General Terms and Conditions; provided, however, that Transporter may, upon reasonable request from a Shipper, agree on a not unduly discriminatory basis to vary from uniform hourly rates on a temporary basis; provided further that Transporter will use commercially reasonable efforts to allow hourly variations in flows to the extent operationally feasible, as determined by Transporter.

11.6 Elimination of Inactive Agreements. In order to eliminate Agreements that Shippers have not nominated and utilized for service for a period of twelve (12) consecutive months, Transporter shall be authorized to notify Shipper by electronic mail, or any other mutually agreed to form of communication in lieu of electronic mail, that the Agreement(s) may be terminated if not utilized during the next six Months following notice, regardless of the original term established under such Agreement(s). Nominations submitted and rejected because of capacity constraints will qualify as being utilized under this provision.

11.7 Scheduled Nominations. Shipper will be required to review its account to view all scheduled nominations. Transporter will notify a Shipper via Electronic Communication if a segmented nomination was not accepted and the reason why.
